import React from 'react';
import logo from './logo.svg';
import './App.css';
const count = 0;
const element = <h1>{count}</h1>;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <section class="couner-container">
          {element}
          <div>
          <button>+</button>
          <button>-</button>
        </div>
        </section>
      </header>
    </div>
  );
}

ReactDOM.render(
  element,
  document.getElementById('root')
);

export default App;
